import React from "react";
import { Nav, Navbar } from "react-bootstrap";
import styled from "styled-components";

const Styles = styled.div`
.navbar{
    background-color: #1949AD;

}
.navbar-brand, .navbar-nav .nav-link{
    color: #f5f6fa;
    &:hover {
        color: #ced6e0;
    }

}
`;
var icon = (
    <span class="logo">
      <a href="/">
        <img src="/logo.png" height="33" width="120" alt="text here" /></a>
    </span>
  );

export const Navigbar = () => (
  <Styles>
    <Navbar brand={icon} toggleNavKey={0} expands="lg">
    <Navbar.Brand href="/"><img src="logo.png" class="img-responsive"/></Navbar.Brand>
      <Navbar.Brand href="/">Swift Chemicals</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Item>
            <Nav.Link href="/">Home</Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link href="/service">Services</Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link href="/team">Our Team</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link href="/contact">Contact</Nav.Link>
          </Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </Styles>
);
